import { Fragment } from "react";

const MealItem = (props) => {
  const mealsList = DUMMY_MEALS.map((meal) => <li>{meal.name}</li>);
  return (
    <Fragment>
      <li>{meal.name}</li>
      <li>{meal.description}</li>
      <li>{meal.price}</li>
    </Fragment>
  );
};

export default MealItem;
